import React from 'react';

const HangmanImage = ({ incorrectGuesses }) => {
  const imagePath = `/hangmandrawings/state${incorrectGuesses}.GIF`;

  return (
    <div className="hangman-image">
      <img src={imagePath} alt={`Hangman stage ${incorrectGuesses+2,11}`} />
    </div>
  );
};

export default HangmanImage;
